const Graph=({valuesToGraph})=>{


    if(valuesToGraph.timeAchieved>0 || valuesToGraph.distanceAchieved>0){

        return("Cardio")

    }
    else if(valuesToGraph.weightAchieved>0){

        return("Weights")

    }
    else if(valuesToGraph.time) {

        return("Calisthenics")

    }

    //return(valuesToGraph)





}

export default Graph;
